[{"name": "mcp__togomcp__search_mesh_entity", "input": {"query": "spinal and bulbar muscular atrophy Kennedy disease", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?disease ?label ?altLabel
WHERE {
  ?disease a <http://nanbyodata.jp/ontology/nando#NANDO_0000001> .
  ?disease rdfs:label ?label .
  OPTIONAL { ?disease skos:altLabel ?altLabel }
  FILTER(CONTAINS(LCASE(STR(?label)), "spinal") && CONTAINS(LCASE(STR(?label)), "bulbar"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?disease ?label ?altLabel
WHERE {
  ?disease rdfs:label ?label .
  OPTIONAL { ?disease skos:altLabel ?altLabel }
  FILTER(CONTAINS(LCASE(STR(?label)), "kennedy") || CONTAINS(LCASE(STR(?altLabel)), "kennedy"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?nando_id ?label
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
    ?Nando a owl:Class ;
        dct:identifier ?nando_id ;
        rdfs:label ?label .
    FILTER(CONTAINS(LCASE(STR(?label)), "kennedy") || 
           CONTAINS(LCASE(STR(?label)), "spinal and bulbar muscular"))
}
LIMIT 10"}}]

